import React from 'react';

import Faker from 'faker';

import './main.css'

class Main extends React.Component {
    // constructor(props) {
    //     super(props);
    //     this.state = {
            
    //     }
    // }
    render () {
        return (
            <div className="main-main-div">
                <img alt="A variety of cars." src={Faker.image.transport()}/>
                <h1>Welcome to The Car Company</h1>
            </div>
        )
    }
}

export default Main;
